"use strict";(self.webpackChunkauthApp=self.webpackChunkauthApp||[]).push([[578],{1578:e=>{e.exports=JSON.parse('[{"key":"0","label":"Inicio","children":[{"key":"0-0","label":"Aclaraciones generales.","data":"/returns-and-refunds","txt":{"es":"<h3>Devoluciones</h3><p>Consideramos una devoluci\xf3n al derecho del cliente de arrepentirse de la compra por cualquier motivo que considere.</p><p> Estos motivos no tendr\xe1n que ver con el servicio prestado pr la empresa y ser\xe1 una desici\xf3n unilateral.</p><h3>Reembolsos</h3><p>Consideramos reembolso a la desici\xf3n por parte de la empresa a devolver el dinero de compra al cliente, luego de que \xe9sta aceptara que es responsable de alguna condici\xf3n en la que crea correcto reembolsar el dinero de compra.</p><h4>Principio b\xe1sico</h4><p>Tambi\xe9n somos clientes de alguien. Por eso te trataremos como queremos ser tratados.</p>"},"type":"url"}]},{"key":"1","label":"Devoluciones","children":[{"key":"1-0","label":"\xbfDe cu\xe1nto tiempo se dispone?","data":"/returns-and-refunds","txt":{"es":"Los clientes pueden devolver los productos hasta 15 d\xedas despues de recibirlos."},"type":"url"},{"key":"1-1","label":"\xbfGastos de devoluci\xf3n?","data":"/returns-and-refunds","txt":{"es":"Los gastos de devoluci\xf3n correr\xe1n a cargo del comprador."},"type":"url"},{"key":"1-2","label":"\xbfQu\xe9 productos pueden ser devueltos?","data":"/returns-and-refunds","txt":{"es":"<p>Solo se pueden devolver productos que se encuentren en el mismo estado en el que fueron enviados.</p><p>No pueden tener se\xf1ales de haber sido usados</p><p>La empresa inspeccionar\xe1 el/los productos devuelto/s y a su sola voluntad desidir\xe1 si este cumple las condiciones para aceptar la devoluci\xf3n.</p><p>En caso de rechazar \xe9sta, el cliente deber\xe1 correr con los gastos de recuperaci\xf3n del producto</p>"},"type":"url"},{"key":"1-3","label":"\xbfEn cu\xe1nto tiempo recibir\xe9 el dinero de mi devoluci\xf3n?","data":"/returns-and-refunds","txt":{"es":"<p>En caso de aprobar la devoluci\xf3n, la empresa dispondr\xe1 de 30 d\xedas laborales para ralizar la anulaci\xf3n del pago efectuado por el cliente, menos los costes de env\xedo que correr\xe1n a cargo del cliente, inclusive cuando \xe9ste haya sido bonificado en la compra.</p><p>El precio de env\xedo descontado ser\xe1 de un cargo fijo de \u20ac20,00</p><p>La empresa no devolver\xe1 dinero al comprador, en cambio otorgar\xe1 una nota de cr\xe9dito, bono o c\xf3digo de descuento que podr\xe1 ser canjeado por otra compra en la tienda.</p><p>\xc9ste \xfaltimo no tendr\xe1 fecha de vencimiento.</p>"},"type":"url"}]},{"key":"2","label":"Reembolsos","children":[{"key":"2-0","label":"\xbfCu\xe1ndo puedo pedir un reembolso?","data":"/returns-and-refunds","txt":{"es":"<p>Siempre ser\xe1 impresindible que la empresa disponga del producto comprado antes de realizar el reembolso.</p><p>Lo anterior significa que el producto puede que todav\xeda no haya salid hacia el cliente o que \xe9ste ya estuviera en transito, para lo que sin importar la condici\xf3n en la que se encuentre el env\xedo. El producto debe estar en manos de la empresa para evaluar un reembolso.</p><p>El o los productos que se intenten reembolsar, deber\xe1n entregarse en la direcci\xf3n que oportunamente fije la empresa y por ninguna raz\xf3n deber\xe1n regresarse al  fabricante, en este caso el o los productos ser\xe1n considerados perdidos por parte del cliente y \xe9stos no ser\xe1n reembolsados de ninguna manera.</p>"},"type":"url"},{"key":"2-1","label":"Sobre la responsabilidad del los productos","data":"/returns-and-refunds","txt":{"es":"<p>La responsabilidad de hacer que el producto llegue nuevamente a la empresa en caso de que \xe9ste haya sido recibido en la direcci\xf3n suministrada en la compra es del cliente e intranferible.</p><p>Desde el momento que el cliente lo reciba ser\xe1 su responsabilidad hacer que llegue a la empresa sin importar los servicios de empresas o terceras personas que participen.</p>"},"type":"url"},{"key":"2-2","label":"Garant\xeda total de entrega","data":"/returns-and-refunds","txt":{"es":"<p>En caso de que el producto no llegara a su destino en un plazo m\xe1ximo de 60 dias laborales, se reembolsar\xe1 el 100% del pago efectuado por parte del cliente independientemente del modo de envio seleccionado en la compra.</p><p>La empresa no devolver\xe1 dinero al comprador, en cambio otorgar\xe1 una nota de cr\xe9dito, bono o c\xf3digo de descuento que podr\xe1 ser canjeado por otra compra en la tienda.</p><p>\xc9ste \xfaltimo no tendr\xe1 fecha de vencimiento.</p>"},"type":"url"}]}]')}}]);